class Queue:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def enqueue(self, item):
        # Push all elements from stack1 to stack2
        while stack1:
            stack2.append(stack1.pop())

        # Push the new item to stack1
        stack1.append(item)

        # Push all elements from stack2 back to stack1
        while stack2:
            stack1.append(stack2.pop())

    def dequeue(self):
        if stack1:
            return stack1.pop()
        else:
            return None  # or raise an exception

    def is_empty(self):
        return len(stack1) == 0

    def size(self):
        return len(stack1)

